    public int OrderOfLargestPlusSign(int N, int[][] mines)
    {
        if (N < 1) return 0;

        ushort[,] dp = new ushort[N, N];
        for (int i = 0; i < N; i++)
            for (int j = 0; j < N; j++)
                dp[i,j] = 250;

        foreach (var mine in mines)
            dp[mine[0], mine[1]] = 0;

        ushort v;
        for (int i = 0; i < N; i++) {
            ushort left = 0;
            ushort right = 0;
            ushort up = 0;
            ushort down = 0;
            
            for (int j = 0, k = N -1; j < N; j++, k--)
            {
                // 从左向右扫描
                v = dp[i, j];
                if (0 < v)
                {
                    if (v > ++left) dp[i, j] = left;
                }
                else dp[i, j] = left = 0;

                // 从右向左扫描
                v = dp[i, k];
                if (0 < v)
                {
                    if (v > ++right) dp[i, k] = right;
                }
                else dp[i, k] = right = 0;

                // 从上向下扫描
                v = dp[j, i];
                if (0 < v) 
                {
                    if (v > ++up) dp[j, i] = up;
                }
                else dp[j, i] = up = 0;

                // 从下向上扫描
                v = dp[k, i];
                if (0 < v)
                {
                    if (v > ++down) dp[k, i] = down;
                }
                else dp[k, i] = down = 0;
            }
        }

        ushort ret = 0;
        for (int i = 0; i < N; i++)
            for (int j = 0; j < N; j++)
                if(ret < dp[i, j]) ret = dp[i, j];
        return ret;
    }
